script: |
  super -f text -I q6581.spq | sort > q6581.out

inputs:
  - name: q6581.spq
    data: |
      SELECT ALL - col0 / 29 AS col0 FROM tab0 (FORMAT parquet) WHERE ( - col1 + col1 * col1 ) NOT BETWEEN 95 + col0 AND col0;
  - name: tab0

outputs:
  - name: q6581.out
    data: |
      -3
      -3
      0
